incorrect_mongo_query:
db.facial_recognition_events.aggregate([
  { $match: { $or: [ { timestamp: { $regex: '^2022' } }, { timestamp: { $gte: ISODate('2022-01-01') } } ] } },
  { $group: { _id: '$camera_id', averageConfidence: { $avg: '$confidence_score' } } },
  { $sort: { averageConfidence: -1 } }
])

