incorrect_mongo_query:
db.object_left_behind_events.find({
  $or: [
    {timestamp: {$regex: ".*" + new Date(new Date().setMonth(new Date().getMonth() - 1)).toISOString() + ".*"}},
    {timestamp: {$gte: new Date(new Date().setMonth(new Date().getMonth() - 1))}},
    {timestamp: {$lte: new Date()}}
  ],
  $or: [
    {event_id: {$exists: true}},
    {object_type: {$exists: true}},
    {confidence_score: {$exists: true}}
  ]
}, {event_id: 1, object_type: 1, confidence_score: 1}).sort({timestamp: 1})

