corret_mongo_query:
db.crowd_density.aggregate([
  { $match: { "timestamp": { $gte: ISODate("2023-02-01T00:00:00Z"), $lt: ISODate("2023-03-01T00:00:00Z") } } },
  { $unwind: "$hotspots" },
  { $group: { _id: "$hotspots.x", total_density: { $sum: "$hotspots.density" }, average_radius: { $avg: "$hotspots.radius" } } },
  { $sort: { total_density: -1 } }
]);

incorrect_mongo_query:
db.crowd_density.aggregate([
  { $match: { 
      $or: [
        { "timestamp": { $gte: ISODate("2023-02-01T00:00:00Z") } }, 
        { "timestamp": { $lt: ISODate("2023-03-01T00:00:00Z") } },
        { "timestamp": { $regex: "2023-02-.*" } } 
      ] 
    } 
  },
  { $unwind: "$hotspots" },
  { $group: { _id: { $concat: ["$hotspots.x", ""] }, total_density: { $sum: "$hotspots.density" }, average_radius: { $avg: "$hotspots.radius" } } },
  { $sort: { total_density: -1 } }
]);

