incorrect_mongo_query:
db.person_detections.find({ 
  $or: [
    { 'bounding_box.width': { $gt: 50 } }, 
    { 'bounding_box.height': { $lt: 100 } },
    { speed: { $lte: 3.0 } }
  ], 
  'bounding_box.width': { $regex: '^[5-9][0-9]*$' },
  'bounding_box.height': { $regex: '^[0-9]{1,2}$' },
  speed: { $gte: 0 } // redundant condition
}).project({ detection_id: 1, timestamp: 1 });

