corret_mongo_query:
db.object_tracking.aggregate([
  { $match: { "object_type": "person", "start_timestamp": { $gte: ISODate("2023-01-01T00:00:00Z") } } },
  { $project: { camera_id: 1, duration: "$duration", average_speed: 1 } },
  { $sort: { average_speed: -1 } }
]);

