db.person_attributes.find({
  $or: [
    { timestamp: { $regex: '.*' + ISODate('START_DATE').toISOString() + '.*' } },
    { timestamp: { $regex: '.*' + ISODate('END_DATE').toISOString() + '.*' } },
    { timestamp: { $gte: ISODate('START_DATE'), $lte: ISODate('END_DATE') } }
  ],
  gender: { $regex: '.*' },
  age_group: { $exists: true }
}, {
  person_id: 1,
  gender: 1,
  age_group: 1,
  height: 1,
  build: 1,
  clothing: 1
}).sort({ person_id: 1 })

